//Header.js

import React from "react";
import { Link } from "react-router-dom";

export default function Header() {
	return (
		<div>
			<header className="journal-header">
			<ol className="head-li">
				<li>
				<h1 className="title">My travel management</h1>

				</li>
				<li className="options">
				<Link to='Event_calen'>Plan trip</Link> </li>
				<li className="options"> log out</li>
			</ol>

			<Routes>
			<Route path="/" element={<Header />}/>
        	<Route path="/plan_trip/Event_calen" element={<Event_calen />}/>
			</Routes>

			</header>
		</div>
	)
}
